{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/issues/1760', 'repository_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract', 'labels_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/issues/1760/labels{/name}', 'comments_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/issues/1760/comments', 'events_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/issues/1760/events', 'html_url': 'https://github.com/spring-cloud/spring-cloud-contract/issues/1760', 'id': 1172431239, 'node_id': 'I_kwDOA6J4xc5F4eGH', 'number': 1760, 'title': 'No consistent date format between the real application, contract tests and generated stub mappings', 'user': {'login': 'virgium03', 'id': 431369, 'node_id': 'MDQ6VXNlcjQzMTM2OQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/431369?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/virgium03', 'html_url': 'https://github.com/virgium03', 'followers_url': 'https://api.github.com/users/virgium03/followers', 'following_url': 'https://api.github.com/users/virgium03/following{/other_user}', 'gists_url': 'https://api.github.com/users/virgium03/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/virgium03/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/virgium03/subscriptions', 'organizations_url': 'https://api.github.com/users/virgium03/orgs', 'repos_url': 'https://api.github.com/users/virgium03/repos', 'events_url': 'https://api.github.com/users/virgium03/events{/privacy}', 'received_events_url': 'https://api.github.com/users/virgium03/received_events', 'type': 'User', 'site_admin': False}, 'labels': [{'id': 1076046667, 'node_id': 'MDU6TGFiZWwxMDc2MDQ2NjY3', 'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/labels/feedback-provided', 'name': 'feedback-provided', 'color': 'ededed', 'default': False, 'description': None}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 4, 'created_at': '2022-03-17T14:18:54Z', 'updated_at': '2022-04-15T11:52:18Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': "Hello,

I'm using `Spring Boot 2.6.3` and `Spring Cloud Contract 3.1.0` and `Jackson 2.11.3` when writing contract ttests. This issue might be possibly related to the Maven plugin.

I am having troubles when dealing with `java.util.Date` objects when writing contract tests using your wonderful library.

First of all, I noticed that the default documented setup with`RestAssuredWebTestClient.standaloneSetup(controller)` does not use the `Jackson Object Mapper` of the application context. I was unpleasantly surprised to find out that the real application was generating `java.util.Date` objects using the `ISO 8601 offset` format (`2022-03-17T10:34:11.815+00:00`) but the application (context) used by the tests was generating the `date as timestamp` format (`1641551651813`). I would say that here, when dealing with dates, there is a big possibility of not being aligned with what the real application would produce. I did not test the behaviour with the new `Java 8` date time classes.

Please note that the real application has no additional `Jackson` or `JSON` configuration for `Spring Boot`.

I was able to overcome the issue by using something along the lines of manually injecting an `ObjectMapper`, creating an `HTTP message converter` and setting it on an instance of `MockMvc`. Maybe the documentation should stress more that the `MockMvc` configuration does not necessarily match the real one or give more details about how to configure it.

```java
@SpringBootTest(classes = {MyConfiguration.class, ActorsController.class})
@AutoConfigureJson
@AutoConfigureJsonTesters
public class BaseContractTestClass {

    @Autowired
    private ActorsController actorsController;

    @Autowired
    private ObjectMapper objectMapper;

    @BeforeEach
    public void setup() {        
        MappingJackson2HttpMessageConverter mappingJackson2HttpMessageConverter = new
                MappingJackson2HttpMessageConverter();
        mappingJackson2HttpMessageConverter.setObjectMapper(objectMapper);
        MockMvc mockMvc = MockMvcBuilders
                .standaloneSetup(actorsController)
                .setMessageConverters(mappingJackson2HttpMessageConverter)
                .build();
        RestAssuredMockMvc.mockMvc(mockMvc);
    }

}
````

In this way I was able to assert in a contract file that the date format matches a predefined format `iso_8601_with_offset` using dynamic body matchers in a `yml` file.

But then, when running the tests on the client consumer side, I noticed that the `JSON` which the client sees has the dates still in the `timestamp` format. I checked the generated stubs and their mappings and, indeed, the dates are not using the `iso_8601_with_offset` format. I don't understand why and I could not find where the problem comes from.

Once again, I would like to point out that there is no special `JSON` `Spring Boot` configuration in the application, just the default one, as far as I'm aware.

Any ideas why and how to get the dates in the same format, in the contract tests on the producer and the generated stubs used by the consumer?

Many thanks,
Virgiliu", 'reactions': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/issues/1760/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/issues/1760/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/issues/comments/1100061055', 'html_url': 'https://github.com/spring-cloud/spring-cloud-contract/issues/1760#issuecomment-1100061055', 'issue_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-contract/issues/1760', 'id': 1100061055, 'node_id': 'IC_kwDOA6J4xc5BkZl_', 'user': {'login': 'marcingrzejszczak', 'id': 3297437, 'node_id': 'MDQ6VXNlcjMyOTc0Mzc=', 'avatar_url': 'https://avatars.githubusercontent.com/u/3297437?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/marcingrzejszczak', 'html_url': 'https://github.com/marcingrzejszczak', 'followers_url': 'https://api.github.com/users/marcingrzejszczak/followers', 'following_url': 'https://api.github.com/users/marcingrzejszczak/following{/other_user}', 'gists_url': 'https://api.github.com/users/marcingrzejszczak/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/marcingrzejszczak/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/marcingrzejszczak/subscriptions', 'organizations_url': 'https://api.github.com/users/marcingrzejszczak/orgs', 'repos_url': 'https://api.github.com/users/marcingrzejszczak/repos', 'events_url': 'https://api.github.com/users/marcingrzejszczak/events{/privacy}', 'received_events_url': 'https://api.github.com/users/marcingrzejszczak/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-15T11:52:18Z', 'updated_at': '2022-04-15T11:52:18Z', 'author_association': 'CONTRIBUTOR', 'body': 'Can you show the contract, the generated test and the WireMock mapping?', 'reactions'