{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/issues/2124', 'repository_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth', 'labels_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/issues/2124/labels{/name}', 'comments_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/issues/2124/comments', 'events_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/issues/2124/events', 'html_url': 'https://github.com/spring-cloud/spring-cloud-sleuth/issues/2124', 'id': 1157574595, 'node_id': 'I_kwDOAeUN_M5E_y_D', 'number': 2124, 'title': 'Tracing information is removed from MDC before logging ', 'user': {'login': 'akefirad', 'id': 2142363, 'node_id': 'MDQ6VXNlcjIxNDIzNjM=', 'avatar_url': 'https://avatars.githubusercontent.com/u/2142363?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/akefirad', 'html_url': 'https://github.com/akefirad', 'followers_url': 'https://api.github.com/users/akefirad/followers', 'following_url': 'https://api.github.com/users/akefirad/following{/other_user}', 'gists_url': 'https://api.github.com/users/akefirad/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/akefirad/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/akefirad/subscriptions', 'organizations_url': 'https://api.github.com/users/akefirad/orgs', 'repos_url': 'https://api.github.com/users/akefirad/repos', 'events_url': 'https://api.github.com/users/akefirad/events{/privacy}', 'received_events_url': 'https://api.github.com/users/akefirad/received_events', 'type': 'User', 'site_admin': False}, 'labels': [{'id': 184100573, 'node_id': 'MDU6TGFiZWwxODQxMDA1NzM=', 'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/labels/question', 'name': 'question', 'color': 'cc317c', 'default': True, 'description': None}, {'id': 1086053970, 'node_id': 'MDU6TGFiZWwxMDg2MDUzOTcw', 'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/labels/feedback-provided', 'name': 'feedback-provided', 'color': 'ededed', 'default': False, 'description': None}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 2, 'created_at': '2021-12-28T08:32:37Z', 'updated_at': '2022-04-15T08:25:54Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': '**Describe the bug**
I'm not sure if it's misconfiguration in my code or a bug in spring-cloud-gateway or any other dependent ones (e.g. sleuth, brave, reactor, etc); the tracing information is not included in logs when there's a route.
For example let's say you have a very simple gateway application (nothing crazy, just a simple app downloaded from start.spring.io with only gateway and sleuth as dependencies) in which you have:
```kotlin
@SpringBootApplication
class Application

fun main(args: Array<String>) {
    runApplication<Application>(*args) {
        addInitializers(
            beans {
                bean {
                    ref<RouteLocatorBuilder>().routes {
                        route {
                            path("/get")
                            uri("https://httpbin.org")
                        }
                    }
                }
            }
        )
    }
}
```
Now if you run the app and call `localhost:8080`, you'd see logs with tracing information:
```logs
2021-12-28 09:26:08.728 DEBUG [gateway,,] 64402 --- [ctor-http-nio-2] o.s.c.s.instrument.web.TraceWebFilter    : Received a request to uri [/]
2021-12-28 09:26:08.732 DEBUG [gateway,,] 64402 --- [ctor-http-nio-2] o.s.c.s.instrument.web.TraceWebFilter    : Handled receive of span NoopSpan(63ee40cad6472dd8/63ee40cad6472dd8)
2021-12-28 09:26:08.756 DEBUG [gateway,63ee40cad6472dd8,63ee40cad6472dd8] 64402 --- [ctor-http-nio-2] o.s.c.s.instrument.web.TraceWebFilter    : Adding a class tag with value [ResourceWebHandler] to a span NoopSpan(63ee40cad6472dd8/63ee40cad6472dd8)
2021-12-28 09:26:08.758 DEBUG [gateway,63ee40cad6472dd8,63ee40cad6472dd8] 64402 --- [ctor-http-nio-2] o.s.c.s.instrument.web.TraceWebFilter    : Handled send of NoopSpan(63ee40cad6472dd8/63ee40cad6472dd8)
```
but if you call `localhost:8080/get` (for which there's a route), you'd get:
```logs
2021-12-28 09:26:53.601 DEBUG [gateway,,] 64402 --- [ctor-http-nio-3] o.s.c.s.instrument.web.TraceWebFilter    : Received a request to uri [/get]
2021-12-28 09:26:53.602 DEBUG [gateway,,] 64402 --- [ctor-http-nio-3] o.s.c.s.instrument.web.TraceWebFilter    : Handled receive of span NoopSpan(2832d97ea4fe4d9a/2832d97ea4fe4d9a)
2021-12-28 09:26:54.342 DEBUG [gateway,,] 64402 --- [ctor-http-nio-3] ientBeanPostProcessor$TracingDoOnRequest : Handled send of the netty client span [NoopSpan(2832d97ea4fe4d9a/aecdeae706b7b839)] with parent [2832d97ea4fe4d9a/2832d97ea4fe4d9a]
2021-12-28 09:26:54.471 DEBUG [gateway,,] 64402 --- [ctor-http-nio-3] PostProcessor$AbstractTracingDoOnHandler : Handle receive of the netty client span [NoopSpan(2832d97ea4fe4d9a/aecdeae706b7b839)]
2021-12-28 09:26:54.474 DEBUG [gateway,,] 64402 --- [ctor-http-nio-3] o.s.c.s.instrument.web.TraceWebFilter    : Handled send of NoopSpan(2832d97ea4fe4d9a/2832d97ea4fe4d9a)
```
I have a general understanding about the internal of how tracing works. But what I found is that in the latter case, the code removes the tracing data from MDC (via `brave.context.slf4j.MDCScopeDecorator.MDCContext#update`) before the actual logging happens. To be precise, it's not just the MDC, but the whole span is closed and there's no tracing context available anymore thanks to the try-with-resource block in `TraceWebFilter.MonoWebFilterTrace#subscribe`.

**Sample**
