deded', 'default': False, 'description': None}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 5, 'created_at': '2022-03-10T14:38:41Z', 'updated_at': '2022-04-13T10:30:56Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': '**Describe the bug**
When setting `spring.sleuth.propagation.type=W3C,B3,CUSTOM` I would expect to be able to include my own propagation as the last item in the list of propagators.

However, in `CompositePropagationFactorySupplier` we create the `CUSTOM` propagator by using `beanFactory.getBeanProvider(PropagationFactorySupplier.class)`. It is not possible to provide a bean of type `PropagationFactorySupplier` without overriding the behaviour entirely.

```java
	@Bean
	@ConditionalOnMissingBean
	PropagationFactorySupplier compositePropagationFactorySupplier(BeanFactory beanFactory,
			SleuthBaggageProperties baggageProperties, SleuthPropagationProperties properties) {
		return new CompositePropagationFactorySupplier(beanFactory, baggageProperties.getLocalFields(),
				properties.getType());
	}
```

If I provide a `Propagation.Factory` then this completely removes Spring integration as `org.springframework.cloud.sleuth.autoconfig.brave.BraveBaggageConfiguration#sleuthPropagationWithB3Baggage` gets overridden.

**NB**
Using `CUSTOM` without providing a `PropagationFactorySupplier` results in `CompositePropagationFactorySupplier` injecting itself into itself.


**Sample**

https://github.com/borismorris-anaplan/sleuth-bug-recreate

I have added two profiles
- `propagation-factory` registers the `Propagation.Factory` as a bean
