one, 'assignees': [], 'milestone': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/milestones/100', 'html_url': 'https://github.com/spring-cloud/spring-cloud-sleuth/milestone/100', 'labels_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/milestones/100/labels', 'id': 7746395, 'node_id': 'MI_kwDOAeUN_M4AdjNb', 'number': 100, 'title': '3.1.2', 'description': None, 'creator': {'login': 'marcingrzejszczak', 'id': 3297437, 'node_id': 'MDQ6VXNlcjMyOTc0Mzc=', 'avatar_url': 'https://avatars.githubusercontent.com/u/3297437?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/marcingrzejszczak', 'html_url': 'https://github.com/marcingrzejszczak', 'followers_url': 'https://api.github.com/users/marcingrzejszczak/followers', 'following_url': 'https://api.github.com/users/marcingrzejszczak/following{/other_user}', 'gists_url': 'https://api.github.com/users/marcingrzejszczak/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/marcingrzejszczak/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/marcingrzejszczak/subscriptions', 'organizations_url': 'https://api.github.com/users/marcingrzejszczak/orgs', 'repos_url': 'https://api.github.com/users/marcingrzejszczak/repos', 'events_url': 'https://api.github.com/users/marcingrzejszczak/events{/privacy}', 'received_events_url': 'https://api.github.com/users/marcingrzejszczak/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 0, 'closed_issues': 5, 'state': 'open', 'created_at': '2022-03-08T09:53:46Z', 'updated_at': '2022-04-13T08:31:43Z', 'due_on': None, 'closed_at': None}, 'comments': 0, 'created_at': '2022-03-28T12:08:16Z', 'updated_at': '2022-04-13T08:31:43Z', 'closed_at': '2022-04-13T08:31:41Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': "**Description**
We are developing spring-boot based applications, which include also components like sleuth, liquibase and rabbitmq. After recent update to **spring-cloud-sleuth** version **3.1.0**, we have experienced strange sideffects with liquibase executing several times, failing on both runs. The real cause of the failure could be usually some error in newly added changeset, but the information about it is completely hidden. Instead of failing the first time, the liquibase start-up bean is instantiated second time in a row. The second failure is visible in the logs, but due to changed conditions (i.e. location of liquibase's databasechangelog-table has changed, some client tables have already been altered, etc) it is not anymore the original error which is visible in the logs. So shortly, the real problem along with the stack trace is completely hidden. Also, spring boot start-up should fail and exit at first such failed bean instantiation, instead of continuing with the start-up and retrying the initializations.

After lot of research we found out, that the problem is in `spring-cloud-sleuth-autoconfigure` library `SkipPatternConfiguration` class. Namely this code in `sleuthSkipPatternProvider` method:
```
		try {
			Pattern result = consolidateSkipPatterns(patterns);
			if (result == null) {
				return null;
			}
			return () -> result;
		}
		catch (BeanCreationException e) {
			// Most likely, there is an actuator endpoint that indirectly references an
			// instrumented HTTP client.
			return () -> consolidateSkipPatterns(patterns);
		}

```
As can be seen, `BeanCreationException` caught from dependent bean instantiations is ignored by that code.

**Expected behaviour**
It actually doesn't matter what exactly the failing dependency in question is, I think this code should re-throw the original exception, but as minimum, I would expect that such errors are at least logged, including with the stack trace.

**Sample**
To provide sample would be quite time consuming. But FYI, here is the rough hierarchy of bean dependencies, which eventually cause the liquibase initialization in our case. Most of these are actuator beans, which I understand is the main target of sleuth-s SkipPatternConfiguration for composing the pattern of skippable endpoints. The dependency between rabbitmq and liquibase is caused by one of our custom @DependsOn annotations, as for the technical reasons inside our application we need the liquibase initialize before any rabbitmq stuff.

`healthEndpoint -> healthContributorRegistry -> rabbitHealthContributor -> rabbit -> liquibase`

**Workaround**
Until this is fixed, we also have found a workaround which is acceptable for us at least for time being. So with following configuration we skip the SkipPatternConfiguration class and manually add the 'actuator' endpoints to the pattern:
```
spring.sleuth:
  web:
    ignore-auto-configured-skip-patterns: true
    additionalSkipPattern: /actuator(/.*)?

```", 'reactions': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/issues/2136/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-sleuth/issues/2136/timeline', 'performed_via_github_app': None}}

